const OutDeviceTypeEnum = Object.freeze(
    {

        ODT_None: 0,
        ODT_PUMP: 1, //
        ODT_FAN: 2,
        ODT_VALVE: 3,
        ODT_LED: 4
    });


 class Outputdevice{
        static Clonbyjsonobj(mobj)
        {
            return new Outputdevice(mobj.Name,  mobj.Channel,mobj.Status);
        }
    
        constructor(dname,  hwchannel,dstatus) {
    
            this.Name =dname;
            this.Channel = hwchannel;
            this.Status =dstatus;
            
        }

}


module.exports = Outputdevice;
module.exports = OutDeviceTypeEnum;
